import React, { useEffect, useState } from "react";
import Web3 from "web3";

const App = () => {
  const [isWalletInstalled, setIsWalletInstalled] = useState(false);
  const [account, setAccount] = useState(null);
  const [name, setName] = useState("");
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("");
  const [state, setState] = useState("");
  const [district, setDistrict] = useState("");

  const ethereum = window.ethereum;
  const MyContractJSON = require("./Aadhar.json");
  const contractAddress = MyContractJSON.networks["5777"].address;
  const contractAbi = MyContractJSON.abi;
  const web3 = new Web3(ethereum);
  const myContract = new web3.eth.Contract(contractAbi, contractAddress);

  useEffect(() => {
    if (window.ethereum) {
      setIsWalletInstalled(true);
    }
  }, []);

  async function connect() {
    try {
      const accounts = await ethereum.request({
        method: "eth_requestAccounts",
      });
      setAccount(accounts[0]);
    } catch (error) {
      alert("Something went wrong");
    }
  }

  const handleGetClick = async () => {
    if (!web3) {
      alert("Please connect your wallet.");
      return;
    }

    try {
      const accountId = "0x..."; // Replace with the Ethereum address you want to query
      const result = await myContract.methods.Get(accountId).call();
      setName(result[0]);
      setAge(result[1].toString()); // Convert age to string
      setGender(result[2]);
      setState(result[3]);
      setDistrict(result[4]);
    } catch (error) {
      console.error("Error calling Get:", error);
      alert("An error occurred while fetching data.");
    }
  };

  return (
    <div>
      <center>
        <h1>Web3 Aadhaar Minter</h1>
      </center>
      <br />
      <br />
      <h3>Enter your details</h3>
      <br />
      <br />
      <span>Name </span>
      <input type="text" placeholder="Enter Your Name" id="nameInput" />
      <br />
      <br />
      <span>Age </span>
      <input type="text" placeholder="Enter Your Age" id="ageInput" />
      <br />
      <br />
      <span>Gender </span>
      <input type="text" placeholder="Male or Female only" id="genderInput" />
      <br />
      <br />
      <span>State </span>
      <input type="text" id="stateInput" />
      <br />
      <br />
      <span>District </span>
      <input type="text" id="districtInput" />
      <button onClick={Get}>Submit</button>{" "}
      <span>
        <button onClick={handleGetClick}>View</button>
      </span>
      <br />
      <br />
      <div>
        <h3>View Aadhaar Details</h3>
        <div>
          <strong>Name:</strong> {name}
        </div>
        <div>
          <strong>Age:</strong> {age}
        </div>
        <div>
          <strong>Gender:</strong> {gender}
        </div>
        <div>
          <strong>State:</strong> {state}
        </div>
        <div>
          <strong>District:</strong> {district}
        </div>
      </div>
    </div>
  );
};

export default App;
